import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import logo from './logo.svg';
import './App.css';
import Chat from "./pages/chat/chat";

function App() {
  return (
      <Router>
        <Routes>
          <Route path = '/chat' element = {<Chat/>}></Route>
          <Route path = '/'></Route>
        </Routes>
      </Router>
  );
}

export default App;
